import React from "react";
import "./News.css";
import image1 from "../User-images/laptop29.webp";
function News() {
  return (
    <div>
      <h1
        style={{
          textAlign: "center",
          fontFamily: "sans-serif",
          fontSize: "50px",
          marginTop: "25px",
        }}
      >
        <b>News</b>
      </h1>
      <h5 style={{ textAlign: "center" }}>
        Get the latest technology news and in-depth analysis from the expert
        analysts at Lappora.
      </h5>
      <hr style={{ marginLeft: "5%", marginRight: "5%" }} />
      <br />

      <div class="col">
        <div class="card h-100">
          <a href="$news_link">
            <img src={{ image1 }} class="card-img-top" />
          </a>
          <div class="card-body">
            <h5 class="card-title">$news_title</h5>
            <p class="card-text">$news_discription</p>
          </div>
          <div class="card-footer">
            <small class="text-body-secondary">Last updated $date ago</small>
          </div>
        </div>
      </div>
    </div>
  );
}

export default News;
